import React from 'react';
import {
    Route,
    Switch,
    BrowserRouter as Router
} from 'react-router-dom';
import routes from './routes';

const status = 'authenticated';

function User() {
    return (
        <>
            <Switch>
                {routes[status].map((route, index) => {
                    return (
                        <Route key={index} path={`${route.path}`}>
                            <route.component />
                        </Route>
                    )
                })}
            </Switch>
        </>
    )
}

export default User;
